import React from 'react'

function Navbar() {
  return (
    <div className='switchPos' id={theme}>
        <div className='switch'>
        <label className='labelforSwitch'>
            {theme === 'light'?'light':'dark'}
            </label>
            <ReactSwitch 
            onChange={toggleTheme}
            checked={theme === 'dark'}
            />
        </div>
        <Link to='/'>指引</Link>
        <Link to='/home'>游戏</Link>
  </div>
  )
}

export default Navbar
